import React from 'react';
import {
  Accordion, Button, Checkbox, DropMenu, Email, Footer,
  Header, InputField, MForm, Modal, Navbar, Pagination,
  Password, RadioButton, Textarea, Login, Dashboard, Register
} from './components/index.js';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import About from './pages/About.js';
import Contact from './pages/Contact.js';
import ErrorPage from './pages/ErrorPage.js';
import Home from './pages/Home.js';
import NotFound from './pages/NotFound.js';
import VehicleChecklist from './pages/VehicleChecklist.js';

import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/vehicle-checklist" element={<VehicleChecklist />} />
          <Route path="/login" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/register" element={<Register />} />
          <Route path="/error" element={<ErrorPage />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
